import React from 'react';

const TweetsList = ({tweets}) => (
    <>
    <div className="grid-container2">
    {tweets.map((tweet, key) => (
        <>
        <div className="tweet" key={key}>
            {tweet.user.map((users, key) => (
                <div key={key}> 
                <h4>{tweet.users.name} {tweet.users.screen_name} <img src={tweet.users.profile_image_url} alt="cannot display" /></h4>
                <p>{tweet.users.location}</p>
                <p>{tweet.text}</p>
                <p>{tweet.created_at} replies: {tweet.reply_count} retweets: {tweet.retweet_count}</p>
                </div>
            ))}
        </div> 
        </>
    ))}
    </div>
    </>
)

export default TweetsList;
